// draw the image flipped horizontally
    int x, y;
    for (x = 0; x < width; x++) {
        for (y = 0; y < height; y++) {
            if (image[y * width + x] != 0x0) {
                plot_pixel(width - x + pos.x, y + pos.y, image[y * width + x]);
            }
        }
    }
