void drawWinner(Game *game) {
    if (game->player1.score > game->player2.score) {
        draw_image(player1Wins, (Position){89, 177}, 150, 22);
    } else if (game->player1.score < game->player2.score) {
        draw_image(player2Wins, (Position){89, 177}, 150, 22);
    }
    else {
        draw_image(tie, (Position){89, 177}, 150, 22);
    }
}

