void initializeBasketball(Basketball *ball) {
    // ensure that the controls from last round are reset so they dont carry over
    keyPressed = false;
    pressedKey = 0;
    
    //Initialize the basketball
    ball->oldPos1.x = 3 * X_DIM / 4;
    ball->oldPos1.x = 3 * Y_DIM / 4;
    ball->oldPos2.x = 3 * X_DIM / 4;
    ball->oldPos2.y = 3 * Y_DIM / 4;
    ball->oldVel1.x = 50*cos(M_PI/4);
    ball->oldVel1.y = 50*sin(M_PI/4);
    ball->oldVel2.x = 50*cos(M_PI/4);
    ball->oldVel2.y = 50*sin(M_PI/4);
    //Initialize the basketball

    ball->initialPos.x = 3 * X_DIM / 4;
    ball->initialPos.y = 3 * Y_DIM / 4;
    ball->currentPos.x = 3 * X_DIM / 4;
    ball->currentPos.y = 3 * Y_DIM / 4;
    ball->startingAngle = M_PI/4;
    ball->initialVel.v0 = 50;
    ball->initialVel.x = 50*cos(M_PI/4);
    ball->initialVel.y = 50*sin(M_PI/4);
    ball->currentVel.v0 = 50;
    ball->currentVel.x = 50*cos(M_PI/4);
    ball->currentVel.y = 50*sin(M_PI/4);
    ball->isMoving = false;
}

bool isItTouchingRing(Basketball ball) {
    // is the lower half of the ball touching the ring?
    bool touching = false;
    
    for (int index = 0; index < 2*BASKETBALL_RADIUS; index++) {
        if ((lowerBounds[index].x <= game.hoop.ringStartPos.x && lowerBounds[index].x >= game.hoop.boardTopPos.x && (lowerBounds[index].y <= game.hoop.ringStartPos.y + 5) && (lowerBounds[index].y >= game.hoop.ringStartPos.y - 5)) 
            || ((lowerBounds[index].x <= (game.hoop.ringEndPos.x + 1)) && (lowerBounds[index].x >= (game.hoop.ringEndPos.x - 1)) && (lowerBounds[index].y <= (game.hoop.ringStartPos.y + 12)) && (lowerBounds[index].y >= (game.hoop.ringStartPos.y - 5)))) {
            touching = true;
            break;
        }
    }
    return touching;
}

void updateVelocity(Basketball *ball) {
    // get the new angle of the ball
    float angle = ball->currentAngle;
    
    // update the old velocities of the ball
    ball->oldVel2 = ball->oldVel1;
    ball->oldVel1 = ball->currentVel;

    // update the velocity of the ball
    ball->currentVel.x = ball->currentVel.v0 * cos(angle);
    ball->currentVel.y = ball->currentVel.v0 * sin(angle);
}

void updateBasketball(Basketball *ball) {
    // updating the velocities and positions of the ball if moving or static

    // If the basketball is not moving and a second hasn't passed, do not update its position or velocity
    if (!ball->isMoving) {
        return;
    }
	
	int deltaTime = ball->projTime;
	
    int new_x = ball->currentPos.x - ball->currentVel.x * deltaTime/20;   // x = v0t
    int new_y = ball->currentPos.y - ball->currentVel.y * deltaTime/20 - (0.5 * GRAVITY) * deltaTime/20 * deltaTime/20;  // y = v0t - 0.5gt^2

    int new_dy = ball->currentVel.y - GRAVITY * deltaTime/20;  // v = v0 - gt

    // Check if the new position is within the screen boundaries
    if (new_x >= 0 && new_x < 320 && new_y >= 0 && new_y < 240) {
        // store the older positions of the ball
        ball->oldPos2 = ball->oldPos1;
        ball->oldPos1 = ball->currentPos;

        // Update the position of the basketball
        ball->currentPos.x = new_x;
        ball->currentPos.y = new_y;

        // store the older velocities of the ball
        ball->oldVel2 = ball->oldVel1;
        ball->oldVel1 = ball->currentVel;

        // Update the velocity of the basketball
        // x velocity remains constant
        ball->currentVel.y = new_dy;  // v = v0 - gt

        // update the other old ball properties            
        ball->oldAngle2 = ball->oldAngle1;
        ball->oldAngle1 = ball->currentAngle;  

        // Update the coordinates of the lower half of the ball
        int radius = BASKETBALL_RADIUS;

        for (int x = -radius, bounds = 0; x <= radius, bounds <= 2*BASKETBALL_RADIUS ; x++, bounds++) {
            int y1 = ball->currentPos.y + sqrt(radius * radius - x * x);

            lowerBounds[bounds].x = ball->currentPos.x + x;
            lowerBounds[bounds].y = y1;
        }
 
        // increment score if the ball passses the ring, check if the vertical velocity component is downwards
        if (!incremented) {
            if (((ball->currentPos.x - BASKETBALL_RADIUS) >= game.hoop.ringStartPos.x) && ((ball->currentPos.x + BASKETBALL_RADIUS) <= game.hoop.ringEndPos.x) /*the ball x-position is inside the ring*/
                && (ball->currentPos.y - BASKETBALL_RADIUS >= (game.hoop.ringStartPos.y - 10)) && (ball->currentPos.y + BASKETBALL_RADIUS <= (game.hoop.ringStartPos.y + 20)) /* the ball is within 30 pixels of the y-postion of the ring*/
                && (ball->currentVel.y < 0)) /* the ball is moving down */ { 
                
                game.currentRound.playerTurn->score++;
                printf("SCORED!\n");
                incremented = true;
            }    
        }
        
        // check if it hit the frame
        if ((new_x - radius*1.5) <= game.hoop.boardTopPos.x && (new_y + radius*1.5) <= game.hoop.boardBottomPos.y && (new_y - radius*1.5) >= game.hoop.boardTopPos.y) {
            // conservation of momentum: assuming elastic collision (no drag / air resistance)
            // m1u1 + m2u2 = m1v1 + m2v2

            erase_basketball(ball);
            // changing the position again due to the rebound so we need to erase the old position from the back buffer and draw the new one on it
            wait_for_vsync();                            // Swap buffers
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // Back buffer

            erase_basketball(ball);
            
            // store the old velocities of the ball
            ball->oldVel2 = ball->oldVel1;
            ball->oldVel1 = ball->currentVel;

            ball->currentVel.x = (-1)* ball->currentVel.x;
            printf("rebounded from frame.\n");

            // update the other old ball properties            
            ball->oldAngle2 = ball->oldAngle1;
            ball->oldAngle1 = ball->currentAngle;
    
            ball->oldPos2 = ball->oldPos1;
            ball->oldPos1 = ball->currentPos;

            erased = true;
            // erase_basketball(&ball);

        // check if the ball hit the ring
        } else if (isItTouchingRing(*ball)) {

            erase_basketball(ball);
            
            // changing the position again due to the rebound so we need to erase the old position from the back buffer and draw the new one on it
            wait_for_vsync();                            // Swap buffers
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // Back buffer
            erase_basketball(ball);

            // store old velocities
            ball->oldVel2 = ball->oldVel1;
            ball->oldVel1 = ball->currentVel;

            ball->currentVel.x = (-1)* ball->currentVel.x;
            ball->currentVel.y = (-1)* ball->currentVel.y;
            printf("rebounded from ring.\n");

            // update the other old ball properties            
            ball->oldAngle2 = ball->oldAngle1;
            ball->oldAngle1 = ball->currentAngle;
    
            ball->oldPos2 = ball->oldPos1;
            ball->oldPos1 = ball->currentPos;

            erased = true;
            // erase_basketball(&ball);
        } 
    
    }
    
    // If the basketball has hit the ground or is out of screen boudaries
    else {
        // update the old positions so they can be erased in every iteration of the while loop
        ball->oldPos2 = ball->oldPos1;
        ball->oldPos1 = ball->currentPos;

        ball->oldAngle2 = ball->oldAngle1;
        ball->oldAngle1 = ball->currentAngle;

        ball->oldVel2 = ball->oldVel1;
        ball->oldVel1 = ball->currentVel;

        ball->currentPos.x = ball->initialPos.x;
        ball->currentPos.y = ball->initialPos.y;
        ball->currentVel.x = ball->initialVel.x;
        ball->currentVel.y = ball->initialVel.y;
        ball->projTime = 0;
        ball->isMoving = false;
        incremented = false;
    }
}

void updateGame(Game *game, int deltaTime) {
    // Update the basketball
    updateBasketball(&game->currentBall);

    // Update the time
    game->currentRound.currentTime += deltaTime;
}

